⁣
BEING A HAIRSTYLIST⁣
⁣
💇🏼‍♀️- connecting with people in a deep and impactful way ⁣
💇🏼‍♀️- making people feel beautiful⁣
💇🏼‍♀️- helping people see themself thru a different (more positive) lense⁣
💇🏼‍♀️- sharing tips and tricks to help them fly without me (learning to style and care for their hair at home)⁣
💇🏼‍♀️- honing a craft or skill to provide the best client experience possible⁣
💇🏼‍♀️- seeing myself grow thanks to the impact and influence of the clients I work with and the people I work with⁣
⁣
BEING A FITNESS COACH⁣

🏋️‍♀️- connecting with people in a deep and impactful way⁣
🏋️‍♀️- making people feel beautiful ⁣
🏋️‍♀️- helping people see themselves thru a different (more positive) lense⁣
lense⁣
🏋️‍♀️- Sharing tips and tricks to help them learn to fly without me (learning nutrition and fitness habits)⁣
🏋️‍♀️- honing a craft or skill to provide the best client experience possible⁣
🏋️‍♀️- seeing myself grow thanks to the impact and influence of the clients I work with and the other coaches I work with⁣
⁣
It may seem strange on the surface, but growing as a fitness coach reinforces all the things I love, that deeply move me in this world. ⁣

I work hard to drop my ego, my self sabotage, and my own limiting beliefs at the door. It is my aim to help people feel seen and heard and helped when they choose me as a hairstylist, or a coach. ⁣
⁣
But that's enough about me! What's the biggest life change you have ever gone thru? I'd love to hear about it!

